export const calculateCoursePrice = async (course) => {

  return await fetch("http://192.168.1.60:5000/api/course/price",{method: 'POST', body: course})
  .then(res => res.json())

  return (
    (course.variant.price +
      course.extras
        .map((extra) => extra.price)
        .reduce((prev, curr) => prev + curr, 0)) *
    course.amount
  );
};
